import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
let list = [
  {id: 1, title: 'Learn React'},
  {id: 2, title: 'learn Nodejs'},
  {id: 3, title: 'learn Nextjs'}
];


function App() {
  const [tasks, useTask] = useState(list);
  return (
    <div className="App">
      <h2>Container</h2>
      {
        tasks.map((task) => {
          return (
          <div>
            <h3>{task.title}</h3>
          </div>
          );
        })
      }
    </div>
  );
}

export default App;
